import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-gradient-to-r from-purple-500 to-indigo-600 p-4 shadow-md">
      <div className="container mx-auto flex justify-between items-center">
        <div className="text-white text-3xl font-bold">
          <Link to="/">Customer Portal</Link>
        </div>
        <div className="space-x-4">
          <Link
            to="/login"
            className="text-white text-lg font-semibold hover:bg-white hover:text-indigo-600 px-4 py-2 rounded transition duration-300 ease-in-out"
          >
            Login
          </Link>
          <Link
            to="/register"
            className="text-white text-lg font-semibold hover:bg-white hover:text-indigo-600 px-4 py-2 rounded transition duration-300 ease-in-out"
          >
            Register
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
